import React from "react";
import TableCard from "../../Table/tableCard";

const CancelledOrders=()=>{
     const ViewItemDetails =(id)=>{
          alert(id);
      }

     const colums= React.useMemo(
         ()=>[
          {
              Header: 'CANCELLED ORDERS',
              columns: [
                  {
                      Header: '#order',
                      accessor: '#order',
                  },
                  {
                      Header: 'Order Name',
                      accessor: 'ordername',
                  },
                  {
                      Header: 'Title',
                      accessor: 'title',
                  },
                  {
                      Header: 'status',
                      accessor: 'status',
                  },
                  {
                      Header: 'Created on',
                      accessor: 'created',
                  },
                  {
                      Header: 'Deadline',
                      accessor: 'deadline',
                  },

                  {
                      Header: 'Pages',
                      accessor: 'page',
                  },

                  {
                      Header: 'Action',
                      accessor: 'action',
                  },

              ],
          },
         ]
     )

       const data=[
           {
              "#order": "committee-c15dw",
              "ordername": "editor-ktsjo",
              "title": 3,
              "status": <span className="badge badge-danger">cancelled</span>,
              "created": '2021-07-7',
              "deadline": '2021-07-7',

              "page": "5",
              "action": <button className="btn btn-info" onClick={()=>ViewItemDetails(5)}>Details</button>
           }
       ]
      return <React.Fragment>
      {!isSingleTaskOpen && <TableCard columns={colums} data={data}/>}
      {isSingleTaskOpen && <SingeleTask isAccept={false} closeTask={handleCloseTask} id={singleTaskId}/>}
      </React.Fragment> 
}

export default CancelledOrders;
